import React, { useState, useEffect } from 'react';

const EmailAnalytics = ({ supabase }) => {
  const [analyticsData, setAnalyticsData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchAnalytics = async () => {
      try {
        setIsLoading(true);

        // Get email campaigns with their performance metrics
        const { data, error } = await supabase
          .from('email_campaigns')
          .select(`
            id,
            campaign_name,
            sent_date,
            email_activity(
              action,
              count
            )
          `)
          .order('sent_date', { ascending: false });

        if (error) throw error;

        setAnalyticsData(data || []);
      } catch (error) {
        console.error('Error fetching analytics:', error);
        setError('Failed to load email analytics. Please try again.');
      } finally {
        setIsLoading(false);
      }
    };

    fetchAnalytics();
  }, [supabase]);

  if (isLoading) return <div>Loading analytics data...</div>;
  if (error) return <div className="error-message">{error}</div>;

  return (
    <div className="analytics-container">
      <h1>Email Analytics</h1>

      {analyticsData.length === 0 ? (
        <p>No campaign data available yet.</p>
      ) : (
        <div className="analytics-content">
          <div className="campaigns-table-container">
            <h2>Campaign Performance</h2>
            <table className="campaigns-table">
              <thead>
                <tr>
                  <th>Campaign</th>
                  <th>Sent Date</th>
                  <th>Sent</th>
                  <th>Opened</th>
                  <th>Clicked</th>
                  <th>Open Rate</th>
                  <th>Click Rate</th>
                </tr>
              </thead>
              <tbody>
                {analyticsData.map((campaign) => {
                  // Calculate metrics
                  const sent = campaign.email_activity?.filter(a => a.action === 'sent')[0]?.count || 0;
                  const opened = campaign.email_activity?.filter(a => a.action === 'opened')[0]?.count || 0;
                  const clicked = campaign.email_activity?.filter(a => a.action === 'clicked')[0]?.count || 0;

                  const openRate = sent > 0 ? ((opened / sent) * 100).toFixed(2) : '0.00';
                  const clickRate = opened > 0 ? ((clicked / opened) * 100).toFixed(2) : '0.00';

                  return (
                    <tr key={campaign.id}>
                      <td>{campaign.campaign_name}</td>
                      <td>{new Date(campaign.sent_date).toLocaleDateString()}</td>
                      <td>{sent}</td>
                      <td>{opened}</td>
                      <td>{clicked}</td>
                      <td>{openRate}%</td>
                      <td>{clickRate}%</td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default EmailAnalytics;
